import troll from "../images/troll-face.png"

function Navbar() {
    return(
        <header className="navbar">
            <img src={troll} className="nav-image" />
            <h2 className="nav-title">Meme Generator</h2>
            <p className="nav-paragraph">React project</p>
        </header>
    ) 
}
export default Navbar
